import React from "react";
import { Navbar, Container, Nav, NavDropdown } from "react-bootstrap";

const Header = () => {
  return (
    // Utilizamos el componente Navbar de React-Bootstrap
    <Navbar id="encabezado" expand="lg" fixed="top">
      <Container fluid>
        {/* Logo: en lugar de url_for se utiliza una ruta local o importamos la imagen */}
        <Navbar.Brand href="/">
          <img
            src="/assets/Images/LogoBeyTours.png"
            height="60"
            alt="Logo BayTours"
          />
        </Navbar.Brand>
        <Navbar.Toggle aria-controls="navbarScroll" />
        <Navbar.Collapse id="navbarScroll">
          <Nav className="ms-auto">
            {/* Ícono de búsqueda, notificaciones, etc. Se pueden adaptar según sea necesario */}
            <Nav.Link href="#">
              <i className="fas fa-search"></i>
            </Nav.Link>
            <NavDropdown title={<i className="fas fa-bell"></i>} id="basic-nav-dropdown">
              <NavDropdown.Header>Notificaciones</NavDropdown.Header>
              <NavDropdown.Item href="#">Notificación 1</NavDropdown.Item>
              <NavDropdown.Item href="#">Notificación 2</NavDropdown.Item>
              <NavDropdown.Divider />
              <NavDropdown.Item href="#">Ver todas</NavDropdown.Item>
            </NavDropdown>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
};

export default Header;
